import { bus } from '@/event-bus';
export default {
  name: 'RotatorTools',
  data() {
    return {
      dialog: false
    };
  },
  methods: {
    reset() {
      this.$ajax.post('/api/v1/users/clear', {
        key: localStorage.getItem('rotator_client_id')
      }).then(() => {
        // eslint-disable-next-line
        this.dialog = false;
        bus.$emit('is_admin', 0);
        bus.$emit('close_dialogs', 0);
      }).catch(error => {
        // eslint-disable-next-line
        console.log(error);
      });
    }
  }
};
